import React from "react";
import Navbar from "../HomePage/Navbar";


const MyCourses=()=>{
    return(
        <>
            <Navbar/>
             <div className="profile-card profile-container">
                    <h4><b>My Courses</b></h4>
                    <a href="/profile/mycourses" className="see-btn">See more...</a>
            </div>

        </>
    );
};

export default MyCourses;
